backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    encrypt = true
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./modules/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.cidr_block
  enable_dns_support   = true
  enable_dns_hostnames = true

  tags = {
    Name = "Cloud-AI-VPC"
  }
}

resource "aws_subnet" "public" {
  vpc_id            = aws_vpc.main.id
  cidr_block        = cidrsubnet(var.cidr_block, 3, 1)
  availability_zone = data.aws_availability_zones.available.names[0]
  map_public_ip_on_launch = true

  tags = {
    Name = "Cloud-AI-Public-Subnet"
  }
}

resource "aws_subnet" "private" {
  vpc_id            = aws_vpc.main.id
  cidr_block        = cidrsubnet(var.cidr_block, 3, 2)
  availability_zone = data.aws_availability_zones.available.names[1]

  tags = {
    Name = "Cloud-AI-Private-Subnet"
  }
}

resource "aws_internet_gateway" "gateway" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "Cloud-AI-IGW"
  }
}

# Using default route tables for demonstration purposes
resource "aws_route" "internet_access" {
  route_table_id         = aws_vpc.main.default_route_table_id
  destination_cidr_block = "0.0.0.0/0"
  gateway_id             = aws_internet_gateway.gateway.id
}

data "aws_availability_zones" "available" {}

./modules/vpc/variables.tf.code:
variable "cidr_block" {
  description = "The CIDR block for the VPC"
  type        = string
  default     = "10.0.0.0/16"
}

./modules/vpc/outputs.tf.code:
output "vpc_id" {
  description = "The ID of the VPC"
  value       = aws_vpc.main.id
}

output "public_subnet_id" {
  description = "The ID of the public subnet"
  value       = aws_subnet.public.id
}

output "private_subnet_id" {
  description = "The ID of the private subnet"
  value       = aws_subnet.private.id
}

output "internet_gateway_id" {
  description = "The ID of the Internet Gateway"
  value       = aws_internet_gateway.gateway.id
}

./modules/ec2/main.tf.code:
resource "aws_launch_configuration" "app_launch_configuration" {
  name_prefix = "app-lc-"
  image_id    = var.ami_id
  instance_type = var.instance_type

  user_data = base64encode(<<-EOF
              #!/bin/bash
              echo "Auto Deployment from Cloud-AI" > /var/www/html/index.html
              EOF)

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_security_group" "app_security_group" {
  name_prefix = "app-sg-"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_autoscaling_group" "app_autoscaling_group" {
  launch_configuration = aws_launch_configuration.app_launch_configuration.id
  vpc_zone_identifier  = var.subnet_ids
  min_size = var.min_size
  max_size = var.max_size

  tag {
    key                 = "Name"
    value               = "app-instance"
    propagate_at_launch = true
  }
}

resource "aws_alb" "app_load_balancer" {
  name_prefix = "app-alb-"
  subnets     = var.subnet_ids
  security_groups = [aws_security_group.app_security_group.id]

  enable_deletion_protection = false

  tags = {
    Name = "app-load-balancer"
  }
}

resource "aws_alb_target_group" "app_target_group" {
  name_prefix = "app-tg-"
  port        = 80
  protocol    = "HTTP"
  vpc_id      = var.vpc_id

  health_check {
    path               = "/"
    interval           = 30
    timeout            = 3
    healthy_threshold   = 2
    unhealthy_threshold = 2
  }

  tags = {
    Name = "app-target-group"
  }
}

resource "aws_alb_listener" "app_listener" {
  load_balancer_arn = aws_alb.app_load_balancer.arn
  port              = 80
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_alb_target_group.app_target_group.arn
  }
}

./modules/ec2/variables.tf.code:
variable "ami_id" {
  description = "The AMI ID that the EC2 instances will use."
  type        = string
}

variable "instance_type" {
  description = "The type of instance to start."
  type        = string
  default     = "t2.micro"
}

variable "vpc_id" {
  description = "The VPC ID where resources will be created."
  type        = string
}

variable "subnet_ids" {
  description = "A list of subnet IDs to launch resources in."
  type        = list(string)
}

variable "min_size" {
  description = "Minimum size of the Auto Scaling Group."
  type        = number
  default     = 1
}

variable "max_size" {
  description = "Maximum size of the Auto Scaling Group."
  type        = number
  default     = 2
}

./modules/ec2/outputs.tf.code:
output "launch_configuration_id" {
  description = "The ID of the launch configuration."
  value       = aws_launch_configuration.app_launch_configuration.id
}

output "autoscaling_group_id" {
  description = "The ID of the autoscaling group."
  value       = aws_autoscaling_group.app_autoscaling_group.id
}

output "load_balancer_dns_name" {
  description = "The DNS name of the load balancer."
  value       = aws_alb.app_load_balancer.dns_name
}

output "load_balancer_zone_id" {
  description = "The zone ID of the load balancer (used in Route 53)."
  value       = aws_alb.app_load_balancer.zone_id
}

output "security_group_id" {
  description = "The ID of the security group."
  value       = aws_security_group.app_security_group.id
}

output "target_group_arn" {
  description = "The ARN of the target group."
  value       = aws_alb_target_group.app_target_group.arn
}

output "listener_arn" {
  description = "The ARN of the listener."
  value       = aws_alb_listener.app_listener.arn
}

./main.tf.code:
module "vpc" {
  source      = "./modules/vpc"
  cidr_block  = "10.0.0.0/16"
}

module "ec2" {
  source       = "./modules/ec2"
  ami_id       = "ami-0b0ea68c435eb488d"
  instance_type = "t2.micro"
  min_size     = 1
  max_size     = 2
  vpc_id       = module.vpc.vpc_id
  subnet_ids   = [module.vpc.public_subnet_id]
}

output "vpc_id" {
  description = "The ID of the VPC"
  value       = module.vpc.vpc_id
}

output "public_subnet_id" {
  description = "The ID of the public subnet"
  value       = module.vpc.public_subnet_id
}

output "autoscaling_group_id" {
  description = "The ID of the autoscaling group."
  value       = module.ec2.autoscaling_group_id
}

output "load_balancer_dns_name" {
  description = "The DNS name of the load balancer, used to access the application."
  value       = module.ec2.load_balancer_dns_name
}
